Pink skincare routine 💕

@thedermacoindia calamine face wash is a nice cleanser and I enjoy using it 

@puresenseworld pink guava face scrub is a mild manual scrub but I mostly use chemical exfoliants so I won’t be repurchasing. But if you are looking for a mild affordable physical exfoliant then you can try it. But keep your expectations low from this

@cosrx_india_official pink clay mask did not impress me because it did not do much for my skin. I prefer Joseon red bean mask over this

@solvedlabs jelly niacinamide serum is really hydrating and gives glow. Love it

@theordinary pink serum failed to impress me. Initially it gave me whiteheads and it pills on my skin most of the time. I expected a lot but did not see any much difference 

@clinique_in is cult favourite and I understand why. It has beautiful texture and amazing ingredients but I have found many other gel moisturisers that worked better on my skin and plus those are more affordable 

@aqualogica.in spf lip balm is wonderful but I love their red lip balm more than this pink one 

@dotandkey.skincare sunscreen stick is a good option for reapplication but don’t make it your primary sunscreen 

#skincare #pink
